<style>
    @import url('https://fonts.googleapis.com/css2?family=Bebas+Neue&display=swap');

    * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
    }
    /*  scroll bar */
    ::-webkit-scrollbar {
        width: 0px;
        /* remove scrollbar space */
        background: transparent;
        /* optional: just make scrollbar invisible */
    }
    .hero {
        min-width: 100%;
        color: #fff;
        overflow: hidden;
        background-image: url("{{ asset('imgs/bgHero.png') }}");
        background-size: cover;
        background-repeat: repeat;
        background-position: center;
        position: relative;
        width: 100%;
        /* hide scroll bar */
        overflow-y: hidden;

        /* background-image: linear-gradient(to right bottom, #8c7ccc, #9584d0, #9d8dd3, #a695d7, #ae9edb, #ae9edb, #ae9edb, #ae9edb, #a695d7, #9d8dd3, #9584d0, #8c7ccc); */
    }

    .hero section {
        width: 100%;
        height: 100vh;
    }

    .first-section,
    .second-section {
        display: flex;
        justify-content: space-between;
        align-items: center;
    }

    .first-section .section-content,
    .second-section .section-content {
        display: flex;
        justify-content: space-between;
        align-items: center;
        width: 100%;
        /* height: 100%; */
        margin: auto;
    }

    .second-section .section-content {
        height: 100%;
        position: relative;
    }

    .first-section>div>div,
    .second-section>div>div {
        width: 50%;
        display: flex;
        height: 100%;
    }

    .first-section .left {
        justify-content: center;
    }

    .second-section .left {}

    .second-section .left img {
        max-width: 100%;
        max-height: 100%;
        object-fit: cover;
    }

    .first-section .right {
        justify-content: flex-end;
    }

    .second-section .right {
        justify-content: flex-start;
    }

    .grp-1 {
        filter: blur(4px);
        transition: all 1s ease-in-out;
        /* animation: blur 6s infinite; */
    }

    .grp-2 {
        filter: blur(0);
        transition: all 1s ease-in-out;
        /* animation: blur 6s infinite; */
    }

    @keyframes blur {
        0% {
            filter: blur(4px);
        }

        50% {
            filter: blur(0px);
        }

        100% {
            filter: blur(4px);
        }
    }

    .animation {
        transition: all .3s cubic-bezier(0.175, 0.885, 0.32, 1.275);
        animation: move .5s cubic-bezier(0.175, 0.885, 0.32, 1.275);
        /* animation-delay: 8s; */
    }

    @keyframes move {
        0% {
            transform: matrix(1, 0, 0, 1, -180, -500) scale(1.5);
            opacity: 0;
        }

        /* 90%{
            transform: matrix(1, 0, 0, 1, -180, -500) scale(0.9);
            opacity: 0;
        } */
        100% {
            transform: matrix(1, 0, 0, 1, 1, 1) scale(1);
            opacity: 1;
        }
    }

    #brush {
        height: 700px;
        transform: translate(-92px, -23px);
    }

    #CONSEILER {
        filter: drop-shadow(5px 5px 1px #12033C);
    }

    .a {
        filter: blur(0) !important;
        transition: all 1s ease-in-out;
    }

    .b {
        filter: blur(4px) !important;
        transition: all 1s ease-in-out;
    }

    .wordHover {
        transition: all .3s cubic-bezier(0.175, 0.885, 0.32, 1.275);
    }

    .grp-2 path {
        transition: all .3s cubic-bezier(0.175, 0.885, 0.32, 1.275);
        /* cursor: pointer; */
    }

    .cls-2 {
        /* fill: #fff; */
        fill: transparent;
        fill-rule: evenodd;
        stroke: #fff;
        stroke-width: 3px;
    }


    .second-section .right {
        justify-content: center;
        height: 100%;
        display: flex;
        align-items: center;
    }

    .YouAerNotAlone {
        height: 75%;
    }
    .hand{
        position: absolute;
        height: 190px;
        top: 0;
        right: 0;
    }
    svg{
        overflow: inherit;
    }
   
    nav{
       position: relative;
       top: 0;
       left: 0;
       width: 100%;
       z-index: 999;
    }
    .nav-bar{
        display: flex;
        justify-content: space-between;
        align-items: center;
        /* padding: 0 20px; */
        height: 80px;
        width: 80%;
        margin: auto;
    }
    .nav-bar ul{
        display: flex;
        justify-content: space-between;
        align-items: center;
        list-style: none;
        padding: 0;
        margin: 0;
    }
    .nav-bar ul li{
        margin: 0 20px;
    }
    .nav-bar ul li a{
        text-decoration: none;
        font-size: 18px;
        font-weight: 500;
    }
    /* .nav-bar ul li a:hover{
        color: #12033C;
    }
    .nav-bar ul li a.active{
        color: #12033C;
    } */
    .logo{
        width: 200px;
    }
    .logo img{
        width: 100%;
    }
    nav ul li a {
        letter-spacing: 2px;
        color: #fff;
        -webkit-transition: color .2s ease;
        -o-transition: color .2s ease;
        transition: color .2s ease;
        padding: 3px 0;
        margin-bottom: 10px;
        position: relative;
        display: inline-block;
    }
    .effect.active{
        color:#12033C
    }
    .effect.active:hover{
        color:#845EC2;
    }
    .effect::before {
        -webkit-transition: width .25s cubic-bezier(0.51, 0.18, 0, 0.88) .1s;
        -o-transition: width .25s cubic-bezier(0.51, 0.18, 0, 0.88) .1s;
        transition: width .25s cubic-bezier(0.51, 0.18, 0, 0.88) .1s;
        background: #845EC2;
    }
    .effect:hover::after, .effect:hover::before {
        width: 100%;
        left: 0;
    }
    .effect.active:before {
        z-index: 2;
    }
    .effect:hover {
        color: #ffd800;
    }
    .effect.active:after {
        background: #ffd800;
        width: 100%;
        left: 0;
    }
    .effect::after {
        -webkit-transition: width .2s cubic-bezier(0.29, 0.18, 0.26, 0.83);
        -o-transition: width .2s cubic-bezier(0.29, 0.18, 0.26, 0.83);
        transition: width .2s cubic-bezier(0.29, 0.18, 0.26, 0.83);
        background: #ffd800;
    }
    .effect::after, .effect::before {
        content: '';
        position: absolute;
        top: calc(100% + 5px);
        width: 0;
        right: 0;
        height: 3px;
    }
    .hamburger {
        position: absolute;
        top: 20px;
        right: 20px;
        z-index: 9999;
        display: none;
        cursor: pointer;
    }
    .hamburger.show {
        display: block;
    }
    .hamburger .line {
        width: 30px;
        height: 3px;
        background: #fff;
        margin: 5px 0;
        transition: all .3s ease-in-out;
    }
    .hamburger.bounce{
        animation: bounceRight 1s ease-in-out infinite;
    }

    @keyframes bounceRight {
        0% {
            transform: translateX(0);
        }
        50% {
            transform: translateX(10px);
        }
        100% {
            transform: translateX(0);
        }
    }
    .hamburger.active .line:nth-child(1){
        transform: rotate(45deg) translate(5px, 5px);
    }
    .hamburger.active .line:nth-child(2){
        opacity: 0;
    }
    .hamburger.active .line:nth-child(3){
        transform: rotate(-45deg) translate(5px, -5px);
    }

    /* hover */
    .hamburger:hover .line{
        background: #845EC2;
    }
    .hamburger.active:hover .line{
        background: #12033C;
    }

    .nav-bar-expand{
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 100vh;
        z-index: 999;
        display: none;
        /* filter the background to blur */
    }
    .nav-bar-expand.active{
        display: block;
    }
   
    .nav-bar-expand .nav{
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        height: 100%;
    }
    .nav-bar-expand .nav ul{
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        list-style: none;
        padding: 0;
        margin: 0;
    }   
    .nav-bar-expand .nav ul li{
        margin: 20px 0;
    }
    .nav-bar-expand .nav ul li a{
        font-size: 30px;
        font-weight: 500;
        color: #FFF;
        text-decoration: none;
        text-transform: uppercase;
        position: relative;
        transition: color .3s ease;

    }
    .nav-bar-expand .nav ul li a:hover{
        color: #12033C;
    }
    .nav-bar-expand .nav ul li a.active{
        color: #12033C;
    }
    .nav-bar-expand .nav ul li a.active:hover{
        color: #FFF;
    }
    .nav-bar-expand .nav ul li a::before{
        content: '';
        position: absolute;
        top: 0;
        left: 0;
        width: 0;
        height: 100%;
        background: #12033C;
        z-index: -1;
        -webkit-transition: width .3s cubic-bezier(0.51, 0.18, 0, 0.88) .1s;
        -o-transition: width .3s cubic-bezier(0.51, 0.18, 0, 0.88) .1s;
        transition: width .3s cubic-bezier(0.51, 0.18, 0, 0.88) .1s;
    }
    .nav-bar-expand .nav ul li a::after{
        content: '';
        position: absolute;
        top: 0;
        left: 0;
        width: 0;
        height: 100%;
        background: #ffd800;
        z-index: -1;
        -webkit-transition: width .25s cubic-bezier(0.29, 0.18, 0.26, 0.83);
        -o-transition: width .25s cubic-bezier(0.29, 0.18, 0.26, 0.83);
        transition: width .25s cubic-bezier(0.29, 0.18, 0.26, 0.83);
    }
    .nav-bar-expand .nav ul li a.active::before{
        width: 100%;
    }
    .nav-bar-expand .nav ul li a.active::after{
        width: 100%;
    }
    .nav-bar-expand .nav ul li a.effect::before{
        content: '';
        position: absolute;
        top: calc(100% + 5px);
        width: 0;
        right: 0;
        height: 3px;
        background: #12033C;
        -webkit-transition: width .3s cubic-bezier(0.51, 0.18, 0, 0.88) .1s;
        -o-transition: width .3s cubic-bezier(0.51, 0.18, 0, 0.88) .1s;
        transition: width .3s cubic-bezier(0.51, 0.18, 0, 0.88) .1s;
    }
    .nav-bar-expand .nav ul li a.effect::after{
        content: '';
        position: absolute;
        top: calc(100% + 5px);
        width: 0;
        left: 0;
        height: 3px;
        background: #ffd800;
        -webkit-transition: width .25s cubic-bezier(0.29, 0.18, 0.26, 0.83);
        -o-transition: width .25s cubic-bezier(0.29, 0.18, 0.26, 0.83);
        transition: width .25s cubic-bezier(0.29, 0.18, 0.26, 0.83);
    }
    .nav-bar-expand .nav ul li a.effect:hover::before{
        width: 100%;
    }
    .nav-bar-expand .nav ul li a.effect:hover::after{
        width: 100%;
    }
    .nav-bar-expand .nav ul li a.effect.active::before{
        width: 100%;
    }
    .nav-bar-expand .nav ul li a.effect.active::after{
        width: 100%;
    }
    .nav-bar-expand .nav ul li a.effect.active:hover::before{
        width: 0;
    }
    .nav-bar-expand .nav ul li a.effect.active:hover::after{
        width: 0;
    }
    .nav-bar-expand .nav ul li a.effect.active:hover{
        color: #FFF;
    }
    .nav-bar-expand{
        background-image: url("{{ asset('imgs/bgHero.png') }}");
        background-size: cover;
        background-position: center;
        background-repeat: no-repeat;
        height: 100vh;
        width: 100%;
    }
    @media (max-width: 600px){
        .first-section svg{
            width: auto !important;
            height: auto !important;
        }
        .first-section .section-content{
           flex-direction: column;
        }
        .first-section>div>div{
            width: 100%;
        }
    }
</style>

