<script src="https://cdnjs.cloudflare.com/ajax/libs/gsap/3.11.5/ScrollToPlugin.min.js"></script>

<script>


    $(document).ready(function() {
        const targets = gsap.utils.toArray('.hero section');

        ScrollTrigger.create({
            start: 0,
            end: 'max',
            snap: {
                snapTo: 1 / (targets.length - 1),
                duration: 2,
                ease: 'sine',
                delay: 0.7,
                directional: false
            },
        });

        var texts = $('#CONSEILER, #DIGITAL, #MARKETING_, #EN, #VENDER_, #DE_, #FACON, #LA_NOUVELLE_, #EST_');
        texts.each(function() {
            $(this).attr('stroke-dasharray', 1000);
        })
        var tl1 = gsap.timeline();
        tl1.from('#brush', 1, {
            opacity: 0,
            ease: "power1.inOut",
        }).from(texts, 5, {
            strokeDashoffset: 1000,
            ease: "power1.inOut",
        }).
        from(texts, 1, {
            fill: 'rgba(255,255,255,0)',
            ease: "power1.inOut",
        });
        var glasses = $('.glasses');
        var tl2 = gsap.timeline({
            onComplete: function() {
                $('.grp-1').removeClass('a');
                $('.grp-2').removeClass('b');
                // animate();
                console.log('done');
            }
        });
        tl2.from(glasses, 5, {
            y: -500,
            ease: "power1.inOut",
        })

        //scroll animation
        gsap.registerPlugin(ScrollTrigger);
        var line=$('#CONSEILER,#est_la_nouvelle,#de_vendre_en,#MARKETING_,#DIGITAL');
        var line1=$('#CONSEILER');
        var line2=$('#est_la_nouvelle');
        var line3=$('#de_vendre_en');
        var line4=$('#MARKETING_');
        var line5=$('#DIGITAL');
        var linesBg=$('#brush');

        //parallax scroll effect with somth scroll
        gsap.to(line1, {
            scrollTrigger: {
                trigger: "#CONSEILER",
                scrub: 3,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top top",
                end: "bottom top",
            },
            y:"650",
            x:"300",
            ease: "none",
            duration: 3,
        });
        gsap.to(line2, {
            scrollTrigger: {
                trigger: "#CONSEILER",
                scrub: 3,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top top",
                end: "bottom top",
            },
            y:"650",
            x:"300",
            ease: "none",
            duration: 3,
        });
        gsap.to(line3, {
            scrollTrigger: {
                trigger: "#CONSEILER",
                scrub: 3,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top top",
                end: "bottom top",
            },
            y:"700",
            x:"300",
            ease: "none",
            duration: 3,
        });
        gsap.to(line4, {
            scrollTrigger: {
                trigger: "#CONSEILER",
                scrub: 3,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top top",
                end: "bottom top",
            },
            y:"700",
            // x:"600",
            ease: "none",
            duration: 3,
        });
        gsap.to(line5, {
            scrollTrigger: {
                trigger: "#CONSEILER",
                scrub: 3,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top top",
                end: "bottom top",
            },
            y:"600",
            x:"600",
            ease: "none",
            duration: 3,
        });
        gsap.to(linesBg, {
            scrollTrigger: {
                trigger: "#CONSEILER",
                scrub: 3,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top top",
                end: "bottom top",
            },
            y:"60",
            x:"-60",
            ease: "none",
            duration: 3,
        });

        
        gsap.from(glasses, {
            scrollTrigger: {
                trigger: "#CONSEILER",
                scrub: 3,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top top",
                end: "bottom top",
            },
            y:"0",
            // x:"300",
            ease: "none",
            duration: 3,
        });
        //.grp-2 from filter blur 0 to 4px
        gsap.fromTo('.grp-2', {
            filter: 'blur(0px)',
        }, {
            scrollTrigger: {
                trigger: "#CONSEILER",
                scrub: true,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top top",
                end: "bottom top",
            },
            filter: 'blur(4px)',
            ease: "none",
            // duration: 3,
        });
        //.grp-1 from filter blur 4px to 0px
        gsap.fromTo('.grp-1', {
            filter: 'blur(4px)',
        }, {
            scrollTrigger: {
                trigger: "#CONSEILER",
                scrub: true,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top top",
                end: "bottom top",
            },
            filter: 'blur(0px)',
            ease: "none",
            // duration: 3,
        });

        var youAreNotAlone = $('#YouAerNotAlone');
        const YouAerNotAlonePaths = $('#YouAerNotAlone path');
        YouAerNotAlonePaths.each(function(i, path) {
            var x = path.getTotalLength();
            var fillcolor = path.attributes.fill.value;
            path.style.stroke=fillcolor;
            path.style.strokeWidth=4;
            path.style.strokeDasharray=x;
            path.style.transition="fill 1s ease-in-out";
            
            gsap.fromTo(path, {
                strokeDashoffset: x,
                fill: 'none',
            }, {
                scrollTrigger: {
                    trigger: "#YouAerNotAlone",
                    scrub: 2,
                    // markers: true,
                    toggleActions: "restart pause reverse pause",
                    start: "top center",
                    end: "+=50 center",
                },
                strokeDashoffset: 0,
                fill: fillcolor,
                ease: "none",
                duration: 3,
            }).delay(i*0.1);
            //fill from none 
            // gsap.fromTo(path, {
            //     fill: 'none',
            // }, {
            //     scrollTrigger: {
            //         trigger: "#YouAerNotAlone",
            //         scrub: 4,
            //         // markers: true,
            //         toggleActions: "restart pause reverse pause",
            //         start: "top center",
            //         end: "+=50 center",
            //     },
            //     fill: fillcolor,
            //     ease: "none",
            //     duration: 3,
            // });
           
        });

        //const .hand
        const hand = $('.hand');

        //from opacity 0 to 1
        //from y 0 to 100
        gsap.fromTo(hand, {
            opacity: 0,
            y: -100,
            x: +100,
        }, {
            scrollTrigger: {
                trigger: "#YouAerNotAlone",
                scrub: 4,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top center",
                end: "+=50 center",
            },
            opacity: 1,
            y: 0,
            x: 0,
            ease: "none",
            duration: 3,
        });

        // const #img
        const img = $('#img');
        //from opacity 0 to 1
        //from y 0 to 100

        gsap.fromTo(img, {
            opacity: 0,
            y: -100,
            x: -500,
        }, {
            scrollTrigger: {
                trigger: "#YouAerNotAlone",
                scrub: 4,
                // markers: true,
                toggleActions: "restart pause reverse pause",
                start: "top center",
                end: "+=50 center",
            },
            opacity: 1,
            y: 0,
            x: 0,
            ease: "none",
            duration: 3,
        });   
    })



